PREFIX dbr: <http://dbpedia.org/resource/>

# Step 1: Find Charles Orlando
SELECT ?charlesOrlando WHERE {
  ?charlesOrlando dbo:title "Dauphin of France" ;
                  dbo:spouse ?spouse .
}

# Step 2: Find the parent of Charles Orlando
SELECT ?parent WHERE {
  ?parent dbo:child ?charlesOrlando .
}

# Step 3: Find Ferdinand I, Holy Roman Emperor
SELECT ?ferdinandI WHERE {
  ?ferdinandI dbo:title "Holy Roman Emperor" ;
                dbo:spouse ?spouse .
}

# Step 4: Find the child of Ferdinand I who is a royalty
SELECT ?child WHERE {
  ?child dbo:parent ?ferdinandI ;
          dbo:title ?title .
  FILTER(?title IN ("King", "Queen", "Prince", "Princess"))
}

# Step 5: Find the successor of the child
SELECT ?successor WHERE {
  ?successor dbo:predecessor ?child .
}
```

