  ?kekuanano dbo:name "Kekūanāoʻa".
  ?kekuanano dbo:children ?child.
  ?child dbo:parents ?parent.
  FILTER(?parent IN (dbr:Hawaiian_monarch, dbr:Hawaiian_ruler)).
  ?kekuanano dbo:reignsDuring ?reign.
  ?reign dbo:mayor ?mayor.
}
